Every day, except for Saturday and Sunday, we go to{school.}On Saturday I get up about a quarter past eight and get changed and wash my face and hands, and brush my hair. After that I go down and have my breakfast after that I wash the dishes and at eleven o'clock I go to town with mum.
When I come back I play outside at Seven o'clock I come in to read and write and at eight o'clock I go back out till my mum tells me to come in. Then I go to my uncles's shop with my dad. At half past ten I come back and watch {television}
Naila Ibqal age 10
